css:
@-moz-document url-prefix("https://www.clubic.com"), domain("clubic.com") {
.grid-padding-x .grid-padding-x {
    margin-right: -10rem;
    margin-left: -10rem;
}
@media print,
screen and (min-width: 64em) {
    .grid-x > .large-8 {
        width: 100%;
    }
}
.show-for-medium.large-4.medium-5.cell-block-container.cell {
    display: none !important;
}
.sticky.grid-x {
    display: none !important;
}
body {
    background: #000;
    color: LightGray;
}
header {
    background: #000;
}
.content-wrapper {
    background: #000;
}
@media print,
screen and (min-width: 48em) {
    .grid-x > .medium-8 {
        width: 100%;
    }
}
}
